measurements.description:
Sixteen flowers on one 104-cm inflorescence and 14 buds on one immature inflorescence;
 sepals and petals ovate, white, strongly blushed dark rose, heavily spotted and blotched dark burgundy, especially along midvein;

lip white, side lobes heavily marked dark burgundy, midlobe central burgundy stripe, yellow centrally each side of medial marking, heavily marked
burgundy distally, picotee, keels yellow marked burgundy; 
column white overlaid and marked dark burgundy, anther cap cream; substance firm; texture matte, lip velvety.
